function() {
  var dom_interactive = performance.timing.domInteractive
  var response_start = performance.timing.responseStart
  var time_to_dom_interactive = dom_interactive - response_start

  return time_to_dom_interactive
}

function() {
  var dom_complete = performance.timing.domComplete
  var response_start = performance.timing.responseStart
  var time_to_dom_complete = dom_complete - response_start

  return time_to_dom_complete
}

function() {
  var dom_complete = performance.timing.domComplete
  var dom_loading = performance.timing.domLoading
  var page_render_time = dom_complete - dom_loading

  return page_render_time
}

function() {
  var load_event_end = performance.timing.loadEventEnd
  var navigation_start = performance.timing.navigationStart
  var total_page_load_time = load_event_end - navigation_start

  return total_page_load_time
}

